// ==UserScript==
// @name         Wanikani: Burn Bell
// @namespace    http://tampermonkey.net/
// @version      1.1.5
// @description  Plays a bell sound when you burn an item
// @author       Kumirei
// @match        https://www.wanikani.com/*
// @match        https://preview.wanikani.com/*
// @license      MIT; http://opensource.org/licenses/MIT
// @grant        none
// ==/UserScript==

;(async function ($, wkof) {
    let settings = {}
    let bellSound = new Audio()
    let bellSources
    const listenerOptions = {passive: true}

    // Script info
    const script_id = 'burn_bell'
    const script_name = 'Burn Bell'

    // Initiate WKOF
    await confirm_wkof()
    wkof.include('Menu,Settings')
    wkof.ready('Settings,Menu').then(load_settings).then(install_menu).then(setBellSources).then(updateBellSound).then(setListeners)

    // Makes sure that WKOF is installed
    async function confirm_wkof() {
        if (!wkof) {
            let response = confirm(
                `${script_name} requires WaniKani Open Framework.\nClick "OK" to be forwarded to installation instructions.`,
            )
            if (response) {
                window.location.href =
                    'https://community.wanikani.com/t/instructions-installing-wanikani-open-framework/28549'
            }
        }
    }

    // Load WKOF settings
    async function load_settings() {
        const defaults = {
            bell: 'high',
            playbackRate: 1,
            volume: 1,
        }
        settings = await wkof.Settings.load(script_id, defaults)
        return settings
    }

    // Installs the options button in the menu
    function install_menu() {
        const config = {
            name: script_id,
            submenu: 'Settings',
            title: script_name,
            on_click: open_settings,
        }
        wkof.Menu.insert_script_link(config)
    }

    // Opens settings dialogue when button is pressed
    function open_settings() {
        const config = {
            script_id,
            title: script_name,
            on_save: () => updateBellSound(true),
            content: {
                bell: {
                    type: 'dropdown',
                    default: 'high',
                    label: 'Bell Sound',
                    hover_tip: 'Play a bell sound when you burn an item',
                    content: {
                        disabled: 'Disabled',
                        high: 'High pitch',
                        low: 'Low pitch',
                        achievement: 'Bell 3',
                        echo: 'Bell 4',
                        attention: 'Bell 5',
                    },
                },
                playbackRate: {
                    type: 'number',
                    label: 'Playback Rate',
                    default: 1,
                    step: 1,
                    min: 0.5,
                    max: 10,
                    hover_tip: 'Playback rate (speed) of the bell',
                },
                volume: {
                    type: 'number',
                    label: 'Volume',
                    default: 1,
                    step: 0.1,
                    min: 0.1,
                    max: 1,
                    hover_tip: 'Volume of the bell',
                },
            },
        }
        new wkof.Settings(config).open()
    }

    function addSRSListener() {
        window.addEventListener('didChangeSRS', onDidChangeSRS, listenerOptions)
    }

    function onDidChangeSRS(e) {
        const srs = e.detail.newLevelText
        if (!/burn/i.test(srs) || settings.bell === 'disabled') return
        bellSound.pause() // Stop if already playing
        bellSound.currentTime = 0 // Seek to the start
        bellSound.play()
    }

    function updateBellSound(play) {
        if (settings.bell === 'high') bellSound.src = bellSources.high
        else if (settings.bell === 'low') bellSound.src = bellSources.low
        else if (settings.bell === 'achievement') bellSound.src = bellSources.achievement
        else if (settings.bell === 'echo') bellSound.src = bellSources.echo
        else if (settings.bell === 'attention') bellSound.src = bellSources.attention
        bellSound.playbackRate = settings.playbackRate
        bellSound.volume = settings.volume
        if (settings.bell !== 'disabled' && play)
        {
            bellSound.playbackRate = settings.playbackRate
            bellSound.volume = settings.volume
            bellSound.play()
        }
    }

    function setBellSources() {
        const highPitchedBell = `data:audio/mp3;base64,`
        const lowPitchedBell = `data:audio/wav;base64,`
        const bellAchievement = `data:audio/wav;base64,`
        const bellEcho = `data:audio/wav;base64,`
        const bellAttention = `data:audio/wav;base64,`

        bellSources = {
            high: highPitchedBell,
            low: lowPitchedBell,
            achievement: bellAchievement,
            echo: bellEcho,
            attention: bellAttention,
        }
    }
})(window.jQuery, window.wkof)
